import * as S from '../../styles/Routine/Routine.style'
import ExerciseCard from './ExerciseCard';

function Pagination({ postsPerPage, totlaPosts, paginate, exercises, openCard }) {
  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(totlaPosts / postsPerPage); i++) {
    pageNumbers.push(i)
  }
  return (
    <>
      {exercises.map((exercise) => (
      <ExerciseCard
        key={exercise.id}
        id={exercise.id}
        type={exercise.type}
        part={exercise.part}
        name={exercise.name}
        duration={exercise.duration}
        calories={exercise.calories} 
        openCard={openCard} />
    ))}
    </>
  )
}

export default Pagination;
